import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import Product from "./pages/Home/Product/Product";
import Products from "./pages/Home/Products/Products";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />
  },
  {
    path: "/products/:id",
    element: <Products />
  },
  {
    path: "/product/:id",
    element: <Product />
  },
])

function App() {
  return (
    <div className="App">
      <RouterProvider router={router} />
    </div>
  );
}

export default App;
